import axios from "axios";
import React from "react";

import { useState, useEffect } from "react"
import { useParams } from "react-router-dom";

// const QUIZ_API_BASE_URL = "http://localhost:8080/api/quiz/{id}/question";

function App(){
  const {id} = useParams();
const QUIZ_API_BASE_URL = "http://localhost:8080/api/quiz/"+`${id}`+"/question";

  const [post, setPost] = React.useState(null);

  React.useEffect(() => {
    axios.get(QUIZ_API_BASE_URL).then((response) => {
      setPost(response.data);
      console.log(response.data);
    });
  }, []);

  if (!post) return null;

  return (
    <div>
      <ul>
      {this.props.quiz.map(quiz => (
                     <li className="qizItem">
                     <span style={{
                         "marginLeft":"50px",
                         "fontSize":"23px"
                     }}>{post.text}</span>
                 </li>
                ))}

            </ul>
    </div>
  );
}

export default App
